import React from 'react';
import { View, Text, TextInput, ScrollView, Image, StyleSheet, TouchableOpacity } from 'react-native';
import { Ionicons, MaterialIcons } from '@expo/vector-icons';

const HomeScreen = () => {
  return (
    <ScrollView style={styles.container}>
      {/* Search Bar */}
      <View style={styles.searchContainer}>
        <Ionicons name="search" size={24} color="gray" style={styles.searchIcon} />
        <TextInput placeholder="Find your taste" style={styles.searchInput} placeholderTextColor="gray" />
      </View>

      {/* Location Section */}
      <View style={styles.locationContainer}>
        <MaterialIcons name="location-on" size={24} color="#ff9800" />
        <View>
          <Text style={styles.locationTitle}>HOME</Text>
          <Text style={styles.locationText}>242 ST Marks Ave, Finland</Text>
        </View>
      </View>

      {/* Category Filters */}
      <View style={styles.categoryContainer}>
        {['All', 'Pizza', 'Beverages', 'Asian'].map((category, index) => (
          <TouchableOpacity key={index} style={styles.categoryButton}>
            <Text style={styles.categoryText}>{category}</Text>
          </TouchableOpacity>
        ))}
      </View>

      {/* Nearest Restaurants */}
      <Text style={styles.sectionTitle}>Nearest Restaurants</Text>
      <ScrollView horizontal showsHorizontalScrollIndicator={false} style={styles.horizontalScroll}>
        {[
          { name: 'Westway', image: 'https://cdn.pixabay.com/photo/2016/03/05/19/02/hamburger-1238246_1280.jpg', discount: '50% OFF' },
          { name: 'Fortune', image: 'data:image/jpeg;base64,' },
          { name: 'Seafood', image: 'data:image/jpeg;base64,' },
        ].map((item, index) => (
          <View key={index} style={styles.restaurantCard}>
            <Image source={{ uri: item.image }} style={styles.restaurantImage} />
            <Text style={styles.restaurantTitle}>{item.name}</Text>
            {item.discount && <Text style={styles.discountText}>{item.discount}</Text>}
          </View>
        ))}
      </ScrollView>

      {/* Popular Restaurants */}
      <Text style={styles.sectionTitle}>Popular Restaurants</Text>
      <ScrollView horizontal showsHorizontalScrollIndicator={false} style={styles.horizontalScroll}>
        {[
          { name: 'Burger Hub', image: 'data:image/jpeg;base64,' },
          { name: 'Sushi Place', image: 'data:image/jpeg;base64,' },
        ].map((item, index) => (
          <View key={index} style={styles.restaurantCard}>
            <Image source={{ uri: item.image }} style={styles.restaurantImage} />
            <Text style={styles.restaurantTitle}>{item.name}</Text>
          </View>
        ))}
      </ScrollView>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, backgroundColor: '#f8f8f8', padding: 15 },
  
  searchContainer: { 
    flexDirection: 'row', 
    backgroundColor: '#fff', 
    borderRadius: 10, 
    padding: 12, 
    alignItems: 'center',
    shadowColor: '#000', 
    shadowOpacity: 0.1, 
    shadowRadius: 3, 
    elevation: 2
  },
  searchIcon: { marginRight: 10 },
  searchInput: { flex: 1, fontSize: 16, color: '#333' },

  locationContainer: { flexDirection: 'row', alignItems: 'center', marginVertical: 15 },
  locationTitle: { fontWeight: 'bold', fontSize: 16, color: '#333' },
  locationText: { color: 'gray', fontSize: 14 },

  categoryContainer: { flexDirection: 'row', justifyContent: 'space-between', marginBottom: 10 },
  categoryButton: { 
    backgroundColor: '#ff9800', 
    padding: 10, 
    borderRadius: 8, 
    marginRight: 8, 
    shadowColor: '#000', 
    shadowOpacity: 0.2, 
    shadowRadius: 3, 
    elevation: 3
  },
  categoryText: { fontSize: 14, fontWeight: 'bold', color: '#fff' },

  sectionTitle: { fontSize: 18, fontWeight: 'bold', marginVertical: 10, color: '#333' },

  horizontalScroll: { paddingBottom: 10 },

  restaurantCard: { 
    backgroundColor: '#fff', 
    padding: 12, 
    borderRadius: 12, 
    marginRight: 12, 
    alignItems: 'center', 
    shadowColor: '#000', 
    shadowOpacity: 0.2, 
    shadowRadius: 5, 
    elevation: 4 
  },
  restaurantImage: { width: 100, height: 70, borderRadius: 8 },
  restaurantTitle: { fontSize: 14, fontWeight: 'bold', marginTop: 5, color: '#333' },
  discountText: { color: 'red', fontWeight: 'bold', fontSize: 12 },
});

export default HomeScreen;
